This is the version updated to 2013 standard in June 2013.

Voyager Advanced features the Voyager 220 and Tilting Super Voyager 221, each in five liveries, with advanced operating controls, realistic systems and authentic sounds. The Super Voyager 221 features switchable tilting round high-speed curves!

The accuracy of the new Advanced driving systems brings an unparalleled degree of realism to the Voyager experience, and twelve challenging new scenarios are also included.



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the readme.pdf.


